- input: "TEXT\x1CC00161786\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's Request for Additional Information dated June 17, 2009 for
    the Semptember Monthly Report. -  1.) The Committee has amended its Statement
    of Orgaization to include the ASDC Partnership Program, a joint fundraising committee.
    - 2.) Calculations for Column B for Lines 21(a)(i), 21(a)(ii), 21(b), and 32 have
    been corrected on this amended report.  -  3) The allocated activity year-to-date
    totals have been reviewed and corrected on this amended report.  -  Please note
    that all subsequent reports are being amended to reflect these changes.  Per the
    agreement between DNC Counsel, Neil Reiff, and RAD Supervisor, Debbie Chacona,
    the Memo Schedule A's that itemize the committees share of the gross contributions
    received through the joint fundraising activities from the ASDC Dollars for Democrats
    and ASDC Partnership Program (Association of State Democratic Chairs) and / or
    the DNC Victory Fund (Democratic National Committee) are provided on a quarterly
    basis.    The transfer of the joint fundraising proceeds received during this
    reporting period from the DNC Victory Fund, ASDC Dollars for Democrats, and ASDC
    Partnership programs represents the committee's share of proceeds for contributions
    received during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the committee.  -   Determination of
    usual and normal charges for Enhanced Online Voter File Access for payments received
    on Schedule A, Line 17 of the Committees report was calculated by the total cost
    of developing and hosting our online voter file and dividing it by the number
    of records within the file as well as the presumed number of overall users.  The
    cost to the organization is then determined by the number of records requested
    and the length of time access will be granted.  i.e. Statewide or congressional
    charges are based on the number of records in the district or entire state as
    requested.  -  Please note that the employees that were disclosed on Schedule
    H4 supporting Line 21(a) as payroll spent less than 25% of their time during the
    period working on any Federal Election Activity or activities in connection with
    a Federal Election therefore salary payments were allocable.  This also includes
    fringe benefits for those specific employees.  -  Transfers in from the Democratic
    National Committee, Democratic Senatorial Campaign Committee and or the Democratic
    Congressional Campaign Committee were not used as the Federal component of expenditures
    or disbursements that were used for federal election activities paid for in any
    part by Levin funds.  The committee utilizes standard accounting procedures and
    a detailed chart of accounts as well as separate bank accounts to ensure that
    Federal funds transferred from national state district and local party committees
    are used in compliance with the CFR.\n"
